import styled from 'styled-components';
import Card from "./Card";

const ContainerRootStyled = styled.div`
    /* width: 100%; */
    display: flex;
    flex-wrap: wrap;
    max-height: 900px;
    align-items: center;
    align-content: center;
    margin-bottom: 30px;
    flex-direction: column;
    max-width: 1280px;

`;


class ContainerRoot extends Component {
    render() {
        return (
            <ContainerRootStyled>
                <Card />
                <Card />
                <Card />
                <Card />

            </ContainerRootStyled>
        )
    }
}

export default ContainerRoot;
